import React, { Component } from 'react';
import { Route, BrowserRouter as Router } from 'react-router-dom'
import './App.css';

import Test from './pages/Test';

function App() {
  return(
    <Router>
      <Route exact path="/" component={Test}/>
    </Router>
  );
}

export default App;
